                <div class="cnt-5-block2" id="cnt-5-block2-help">
                    <h1>Support Food Banks</h1>
                    <p>Emergency food providers (food banks, food pantries and soup kitchens)
        can purchase and acquire food in bulk, which means that a dollar donated
        can go many times farther than a dollar spent on cans for a food drive.
        Cash donations also help pay the important but often overlooked overhead
        costs of running a food pantry or soup kitchen, such as transportation or utilities. Find out where to donate <a href="find">here</a></p>
                </div>
            </div>
        </section>

        <section class="content-3" id="helping-cnt-2">
            <div class="content-3-bg" id="content-3-bg-help">
                <div class="cnt-3-block1" id="act-cnt-3-two">
                    <h1 class="cnt-3-item1">Care for others</h1>
                    <h2>Increasing the minimum wage is a lasting way to reduce hunger and bring
        people out of poverty. A bill to increase the federal minimum wage has been
         introduced in the Senate, and there are
        also many efforts to raise the minimum wage on state and local levels.</h2>

                </div>
        </section>

        <section class="content-5" id="helping-cnt-3">
            <div class="content-5-bg" id="content-5-bg-helper">
            <div class="cnt-5-block1" id="cnt-5-block1-helper">
            <h1>Be a Volunteer</h1>
                    <p>Many emergency food providers are in need of volunteers
with specialized skills, such as accounting, social media
or website design. If you have something unique to offer, talk to
the organization to see how you can get involved. Find out where to volunteer <a href="find">here</a></p>
                </div>
